import React from "react";
import { useSelector } from "react-redux";
import * as selectors from '../../redux/users/user-selector'
import s from './List.module.css'
export default function List() {
    const repositories = useSelector(selectors.getState);

    return (
        <ul className={s.list}>{repositories.map((repo) => (<li key={repo.id} className={s.item} >
            <img className={s.img} src={repo.owner.avatar_url} alt='dfsdf' />
            <p className={s.name}>{ repo.name}</p>
        </li>))}
        </ul>
    );
 }
